import React from 'react'
function Defaultlayout()
{
   return(
      <div>
         <div className="header">
            <div className="d-flex justify-content-between">
               <h1>CAR RENTAL</h1>
               <button>User</button>
            </div>
         </div>
         <div className="content">
        {prop.children}
         </div>
      </div>
   )
}
export default Defaultlayout
